() => {
		let schema_amounts = Register_form.data.RegisterBundle_schemaAmounts.split(";");
		let length = schema_amounts.length;
		let schema_asset_amounts = new Array(length);		
		for (let i=0; i<length;i++){
			let schema_amounts_aux = schema_amounts[i].split(",");
			let amount_length = schema_amounts_aux.length;
			let schema_asset_amounts_aux = new Array(amount_length);
			for (let j=0; j<amount_length; j++) {
				schema_asset_amounts_aux[j] = parseInt(schema_amounts_aux[j]);
			}
			schema_asset_amounts[i] = schema_asset_amounts_aux;
		}		
		return schema_asset_amounts
	}
